import React from 'react';

function Player({ players }) {
  return (
    <div>
      <b>{players.name}</b> <span>({players.team})</span>
    </div>
  );
}

function PlayerList() {
  const players = [
    {
      id: 1,
      name: '이대호',
      team: '롯데 자이언츠',
      position: '지명타자'
    },
    {
      id: 2,
      name: '손아섭',
      team: '롯데 자이언츠',
      position: '우익수'
    },
    {
      id: 3,
      name: '김원중',
      team: '롯데 자이언츠',
      position: '마무리 투수'
    }
  ];

  return (
    <div>
      {players.map(player => (
        <Players player={player} key={player.id} />
      ))}
    </div>
  );
}

export default PlayerList;
